import React from "react";
import HeadScuderri from "./components/HeadScuderri";
import Dostizheni from "./components/Dostizheni";
import News from './components/News';
import Tracci from './components/Tracci';
import CarInfo from "./components/CarInfo";
import DriverCard from "./components/DriverCard";
import DriverCardDeskription from "./components/DriverCardDeskription";
import SponsorsSlider from "./components/SponsorsSlider";
import FAQ from "./components/FAQ";
import StaffSlider from "./components/StaffSlider"; 
import "./index.css";
import "./components.css"
import "./components2.css"
import "./components3.css"
import "./components4.css"
import "./components5.css"

const drivers = [
    {
      name: "Льюис Хэмилтон",
      quote: "часть меня всегда лелеяла мечту участвовать в гонках в красном...",
      bio: "Льюису было всего восемь лет, когда он начал заниматься картингом...",
    },
    {
      name: "Шарль Леклер",
      quote: "с тех пор как я был ребенком, моей самой заветной мечтой было...",
      bio: "Он начал участвовать в картинговых гонках в возрасте пяти лет...",
    },
    {
      name: "Чжоу Гуаньюй",
      quote: "Я думаю, что для меня я оставил достаточно наследия...",
      bio: "Чжоу Гуаньюй — первый китайский пилот в истории Формулы 1...",
    },
  ];

function App() {
  const [isPartnersOpen, setIsPartnersOpen] = React.useState(false);

  const togglePartners = () => {
    setIsPartnersOpen(!isPartnersOpen);
  };

  return (
    <div className="App">
      <HeadScuderri
        isPartnersOpen={isPartnersOpen}
        togglePartners={togglePartners}
      />
      <div className="App">
        <Dostizheni />
      </div>

      return 
    <div className="App">      
      <CarInfo backgroundImage="../public/фото/bolide-cut.png" />
    </div>

      <div className="pilots-section">
        <DriverCard driver={drivers[0]} />
      </div>

      <div className="tracci-selection">
        <Tracci />
      </div>

      <div className="news-section">
        <News />
      </div>

      <div className="staff-section">
        <StaffSlider />
      </div>

      <section className="sponsors-section">
        <h2>Спонсоры</h2>
        <SponsorsSlider />
      </section>

      <div className="faq-section">
        <FAQ />
      </div>
    </div>
  );
}

export default App;
